use ElectricCommander;
use ElectricCommander::PropDB;
my $ec = new ElectricCommander();
$ec->abortOnError(0);
my $pb = ElectricCommander::PropDB->new($ec, "");

$pb->setProp('$[property]' , q{$[property_content]});

